function iconMakerInl(
  objs,
  alttext,
  { size, customColor1, customColor2 } = {}
) {
  const msize = size || '40px'
  const tobjs =
    typeof objs === 'function' ? objs({ customColor1, customColor2 }) : objs
  return (args) => {
    return (
      <svg
        viewBox='0 0 200 200'
        className='fiIcons'
        width={args?.newSize || msize}
        height={args?.newSize || msize}
        alt={alttext}
      >
        {tobjs}
      </svg>
    )
  }
}

